import Document, { Head, Main, NextScript } from "next/document";

class CustomDocument extends Document {
  render() {
    return (
      <html>
        <Head>
          <title>Daeun's Portfolio Site</title>
          <link rel='stylesheet' href='css/styles.css' />
        </Head>
        <body>
          <Main />
          <NextScript />
        </body>
      </html>
    );
  }
}

export default CustomDocument;
